validateInputAndBuild();
function buildInfoTable() {
  const infoTable = document.createElement("table");
  infoTable.id = "info-table";
  infoTable.classList.add("tableau");
  const headers = ["Paramètre", "Valeur"];
  const headerRow = document.createElement("tr");
  headers.forEach((headerText) => {
    const th = document.createElement("th");
    th.innerText = headerText;
    headerRow.appendChild(th);
  });
  infoTable.appendChild(headerRow);
  const inputValues = [
    { name: "Montant", value: baseMontant },
    { name: "Taux", value: baseTaux },
    { name: "Durée", value: baseDuree },
    { name: "Périodicité", value: basePeriodicite },
    { name: "Type", value: baseType + " constante" }
  ];
  inputValues.forEach((input) => {
    const row = document.createElement("tr");
    const nameCell = document.createElement("td");
    nameCell.innerText = input.name;
    row.appendChild(nameCell);
    const valueCell = document.createElement("td");
    valueCell.innerText = input.value.toString();
    row.appendChild(valueCell);
    infoTable.appendChild(row);
  });
  return infoTable;
}
document.getElementById("export")?.addEventListener("click", () => {
  const exportFormatSelect = document.getElementById("export-format");
  if (exportFormatSelect === null)
    throw new Error("export format selector not found");
  switch (exportFormatSelect.value) {
    case "md":
      exportMarkdown();
      break;
    case "pdf":
      exportPDF();
      break;
  }
});
function exportPDF() {
  let tableBody = document.getElementById("tableau");
  if (tableBody === null)
    throw new Error("tableau not found");
  let exportElement = document.createElement("div");
  exportElement.appendChild(buildInfoTable());
  exportElement.appendChild(tableBody);
  const doc = new E;
  doc.html(exportElement, {
    callback: function(doc2) {
      doc2.save();
      document.body.appendChild(tableBody);
    },
    x: 1,
    y: 1,
    width: 65,
    windowWidth: 200,
    autoPaging: "text"
  });
}
function exportMarkdown() {
  let infoMarkdown = `## Paramètres 

`;
  infoMarkdown += `| Paramètre | Valeur |
`;
  infoMarkdown += `|-----------|--------|
`;
  const inputValues = [
    { name: "Montant", value: baseMontant },
    { name: "Taux", value: baseTaux },
    { name: "Durée", value: baseDuree },
    { name: "Périodicité", value: basePeriodicite },
    { name: "Type", value: baseType + " constante" }
  ];
  inputValues.forEach((input) => {
    infoMarkdown += `| ${input.name} | ${input.value} |
`;
  });
  let dataMarkdown = `## Valeurs calculés

`;
  dataMarkdown += `| Période | Capital | Intérêt | Amortissement | Annuité | Capital Restant |
`;
  dataMarkdown += `|---------|---------|---------|---------------|---------|-----------------|
`;
  const tableBody = document.getElementById("tableau-body");
  if (tableBody) {
    const rows = tableBody.getElementsByTagName("tr");
    for (let i3 = 0;i3 < rows.length; i3++) {
      const cells = rows[i3].getElementsByTagName("td");
      let rowMarkdown = "|";
      for (let j2 = 0;j2 < cells.length; j2++) {
        rowMarkdown += ` ${cells[j2].innerText} |`;
      }
      dataMarkdown += rowMarkdown + `
`;
    }
  }
  const markdownContent = infoMarkdown + `

` + dataMarkdown;
  const blob = new Blob([markdownContent], { type: "text/markdown" });
  const url = URL.createObjectURL(blob);
  const a3 = document.createElement("a");
  a3.href = url;
  a3.download = "loan_calculation.md";
  document.body.appendChild(a3);
  a3.click();
  document.body.removeChild(a3);
  URL.revokeObjectURL(url);
}
